import React from "react";

function Home() {
  return (
    <div className="home">
      <div className="about">
        <h2>Hello, my name is Christian</h2>
        <div className="prompt">
          {" "}
          <p> A web developer </p>
        </div>
      </div>
      <div className="skills"></div>
    </div>
  );
}
export default Home;
